import React from 'react';
import Navigation from '../components/Navigation';

const Home = () => {
  return (
    <>
      <Navigation
        Title="URL-shortener"
        Links={[
          {
            title: 'Login',
            ref: '/login'
          }
        ]}
      />
    </>
  );
};

// We need to export our component to make it accesible elswhere
export default Home;
